import React, { useEffect, useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import { Layout } from './components/layout';
import { ROUTES } from './constants/routes';
import { motion, AnimatePresence } from 'framer-motion';

// Page imports
import Home from './pages/Home';
import ContactPage from './pages/Contact';
import AdmissionProcessPage from './pages/AdmissionProcess';
import CVJobsPortalPage from './pages/CVJobsPortal';

// Preloader Component
const Preloader = () => (
  <motion.div
    initial={{ opacity: 1 }}
    exit={{ 
      opacity: 0,
      transition: { duration: 0.8, ease: "easeInOut" } 
    }}
    className="fixed inset-0 z-50 flex items-center justify-center bg-gradient-to-br from-indigo-900 via-blue-800 to-purple-800"
  >
    <div className="relative">
      {/* Background shapes */}
      <div className="absolute -left-32 -top-32 w-64 h-64 bg-white/5 rounded-full blur-3xl"></div>
      <div className="absolute right-0 bottom-0 w-64 h-64 bg-white/5 rounded-full blur-3xl"></div>

      <div className="text-center relative z-10">
        <motion.div
          animate={{ 
            scale: [1, 1.2, 1],
            rotate: [0, 360],
            borderRadius: ["20%", "50%", "20%"]
          }}
          transition={{
            duration: 3,
            repeat: Infinity,
            ease: "easeInOut"
          }}
          className="w-24 h-24 mx-auto relative"
        >
          <div className="absolute inset-0 bg-gradient-to-r from-indigo-500 to-blue-500 rounded-xl"></div>
          <div className="absolute inset-1 bg-indigo-900 rounded-xl flex items-center justify-center">
            <span className="text-4xl">ðŸŽ“</span>
          </div>
          <motion.div
            className="absolute inset-0 border-2 border-white/30 rounded-xl"
            animate={{ opacity: [0, 1, 0] }}
            transition={{
              duration: 2,
              repeat: Infinity,
              ease: "easeInOut"
            }}
          />
        </motion.div>

        <motion.div
          initial={{ opacity: 0, y: 10 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.3, duration: 0.8 }}
          className="mt-8"
        >
          <h2 className="text-3xl font-bold bg-gradient-to-r from-white via-blue-200 to-indigo-100 bg-clip-text text-transparent mb-3">
            STEPS EDUCATION
          </h2>
          <div className="w-16 h-1 bg-gradient-to-r from-indigo-500 to-blue-500 rounded-full mx-auto mb-4"></div>
          <p className="text-indigo-200 text-lg">Loading your educational journey...</p>
        </motion.div>

        <motion.div 
          className="w-48 h-1.5 bg-indigo-800 mt-10 rounded-full overflow-hidden mx-auto"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.5 }}
        >
          <motion.div 
            className="h-full bg-gradient-to-r from-indigo-500 to-blue-500 rounded-full"
            initial={{ width: "0%" }}
            animate={{ width: "100%" }}
            transition={{ 
              duration: 2,
              ease: "easeInOut",
            }}
          />
        </motion.div>
      </div>
    </div>
  </motion.div>
);

function App() {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate loading time
    const timer = setTimeout(() => {
      setLoading(false);
    }, 2000);

    return () => clearTimeout(timer);
  }, []);

  return (
    <>
      <AnimatePresence>
        {loading && <Preloader />}
      </AnimatePresence>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path={ROUTES.ADMISSION_PROCESS} element={<AdmissionProcessPage />} />
          <Route path={ROUTES.CV_JOBS} element={<CVJobsPortalPage />} />
          <Route path={ROUTES.CONTACT} element={<ContactPage />} />
        </Route>
      </Routes>
    </>
  );
}

export default App;
